import React, { Component } from "react";
import { Grid, Col, Row } from "react-bootstrap";

class Home extends Component {
  render() {
    return (
      <div>
        <Grid style={{ width: "100%" }}>
          <Row className="show-grid">
            <Col md={6} mdPush={6}>
              <code>{"<Col md={6} mdPush={6} />"}</code>
            </Col>
            <Col md={6} mdPull={6}>
              <code>{"<Col md={6} mdPull={6} />"}</code>
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}
export default Home;
